import React from "react";

import { Tile } from "../tile/Tile";

export const TileList = ({ data }) => {
  return (
    <div>
      {data.map((contact, index) => {
        const { cName, ...cDescription } = contact;
        return <Tile key={index} name={cName} description={cDescription} />;
      })}
    </div>
  );
};
